  String skipStatement() throws ParseException {StringBuilder s = new StringBuilder();
    Token tok = getToken(0);
    boolean first = true;

    if (tok.image != null) {
        s.append(tok.image);
    }
    /* FIXME here, two option, we skip during an error, or outside
       an error, currently both can fail with a TokenMgrError, should
       we catch all, or only when filling message for errors? 
       
       -> taking the "always skip" approach.
    */
    while (true) {
        try {
            tok = getToken(1);
            if (tok.kind == EOF) {
                if (first) {
                    return null;
                } else {
                    break;
                }
            }
            if (tok.kind == LBRACE) {
                s.append(tok.image);
                getNextToken();
                s.append(skip_to_matching_brace());
                getNextToken();
                tok = getToken(1);
                break;
            } else if ((tok.kind == RBRACE) || (tok.kind == SEMICOLON)) {
                s.append(tok.image);
                // we might need a mode here, skip to brace or to semicolon (or both)
                getNextToken();
                tok = getToken(1);
                break;
            } else if ((tok.kind == SCO) && (ac.getCssVersion().compareTo(CssVersion.CSS3) >= 0)) {
                // we found a comment start, meaning it is not terminated, we
                // must "eat" until EOF
                do {
                        tok = getNextToken();
                } while (tok.kind != EOF);
                break;
            } else {
                s.append(tok.image);
            }
            getNextToken();
        } catch (TokenMgrError tokenerror) {
            // read one char at a time, and loop
            try {
                s.append(jj_input_stream.readChar());
                continue;
            } catch (java.io.IOException ioex) {
                return s.toString().trim();
            }
        }
        first = false;
    }
    // skip white space
    while (tok.kind == S) {
        getNextToken();
        tok = getToken(1);
    }
    String statement = s.toString().trim();
    return statement;
  }

  String skip_to_matching_brace() throws ParseException {StringBuilder s = new StringBuilder();
    Token tok;
    int nesting = 1;
    /* FIXME
       same as above */
    while (true) {
        tok = getToken(1);
        if (tok.kind == EOF) {
            break;
        }
        if (tok.kind == LBRACE) {
            nesting++;
        } else if (tok.kind == RBRACE) {
            nesting--;
            if (nesting == 0) {
                s.append(tok.image);
                break;
            }
        }
        s.append(tok.image);
        getNextToken();
    }
    return s.toString();
  }

  String skip_to_matching_paren() throws ParseException {StringBuilder s = new StringBuilder();
    Token tok;
    int nesting = 1;
    /* FIXME
       same as above */
    while (nesting > 0) {
        tok = getToken(1);
        if (tok.kind == EOF) {
            break;
        }
        switch(tok.kind) {
            case LPAREN:
            case FUNCTION:
            case FUNCTIONLANG:
            case FUNCTIONDIR:
            case FUNCTIONIS:
            case FUNCTIONWHERE:
            case FUNCTIONHAS:
            case FUNCTIONHOST:
            case FUNCTIONHOSTCONTEXT:
            case FUNCTIONSLOTTED:
            case FUNCTIONNTHCHILD:
            case FUNCTIONNTHLASTCHILD:
            case FUNCTIONNTHCOL:
            case FUNCTIONNTHLASTCOL:
            case FUNCTIONNTHOFTYPE:
            case FUNCTIONNTHLASTOFTYPE:
            case FUNCTIONNOT:
            case FUNCTIONCALC:
            case FUNCTIONMIN:
            case FUNCTIONMAX:
            case FUNCTIONCLAMP:
            case FUNCTIONATTR:
            case FUNCTIONVAR:
                s.append(tok.image);
                nesting++;
                getNextToken();
                break;
            case RPAREN:
                nesting--;
                if (nesting == 0) {
                    break;
                }
            default:
                s.append(tok.image);
                getNextToken();
        }
    }
    return s.toString();
  }

